import React from 'react';
import { baseAna, elseAna, techAna } from '../../constant';

function ToolNavComp() {
    return (
        <>
            <div className = 'row mx-auto py-3' style = {{ width : "50vw" }}>
                <div className = "card h-100 p-0">
                    <div className = "card-header text-center">
                        基本面分析
                    </div>

                    <div className = "card-body">
                        <ul className = 'list-group list-group-flush'>
                            {
                                baseAna.map(function(ele, i){
                                    return <li className = "list-group-item" ><a href = {ele["url"]}>{ele["method"]}</a></li>
                                })
                            }
                        </ul>
                    </div>
                </div>
            </div>

            <div className = 'row mx-auto py-3' style = {{ width : "50vw" }}>
                <div className = "card h-100 p-0">
                    <div className = "card-header text-center">
                        技術面分析
                    </div>

                    <div className = "card-body">
                        {(() => {
                            let list_render = []
                            let temp = []

                            for(let i = 0; i < techAna.length; i++){
                                list_render.push(
                                    <ul key = {i} className="list-group list-group-horizontal">{temp[0]}</ul>
                                )

                                if((i % 3 === 0 ) && (i !== 0)){
                                    list_render.append(<ul key = {i} className="list-group list-group-horizontal">{temp[0]}</ul>)
                                }else{
                                    temp.push(<li className = "list-group-item"><a href = {techAna[i]["url"]}>{techAna[i]["method"]}</a></li>)
                                };
                            };

                            return list_render
                        })()}
                        {/* <ul className = 'list-group list-group-flush'>
                            {
                                techAna.map(function(ele, i){
                                    return <li className = "list-group-item"><a href = {ele["url"]}>{ele["method"]}</a></li>
                                })
                            }
                        </ul> */}
                    </div>
                </div>
            </div>

            <div className = 'row mx-auto py-3' style = {{ width : "50vw" }}>
                <div className = "card h-100 p-0">
                    <div className = "card-header text-center">
                        其他
                    </div>

                    <div className = "card-body">
                        <ul className = 'list-group list-group-flush'>
                            {
                                elseAna.map(function(ele, i){
                                    return <li className = "list-group-item"><a href = {ele["url"]}>{ele["method"]}</a></li>
                                })
                            }
                        </ul>
                    </div>
                </div>
            </div>
        </>
    );
}

export default ToolNavComp;
